import { useDispatch, useSelector } from "react-redux"
import { Addprodact } from "./slice/prodactr"

function Pordact(){
const dispatch=useDispatch()
const prodacts=useSelector(state=>state.PordactReduser)
return(
<div>
<button onClick={()=>dispatch(Addprodact({id:1,title:"asas"}))}>AddProdact</button>
{prodacts}
</div>
     )
}
export default Pordact
